    false,nt"url": null,nt"notes": "The following recovery plan is the second
    revision of the Delmarva Fox Squirrel Recovery Plan and is based upon information
    obtained from previous planning efforts of the United States Fish and Wildlife Service
    in 1979 and 1983. The original recovery plan, approved in 1979 and revised in 1983,
    emphasized (1) the need to identify optimum habitat for the squirrel and (2) use
    of this information to translocate Delmarva fox squirrels into suitable habitat
    outside currently occupied areas but within their historical range. This plan defines
    a continuing course of action for protecting and recovering the endangered Delmarva
    fox squirrel.",nt"license_title": "License Not Specified",nt"extras":
